import React from 'react';
import './App.css';

function AddButton(props:any) {
  const numbers = props.numbers;
  const listItems = numbers.map((number:number) =>
    <li key={number.toString()}>
      {number}
    </li>
  );
  return (
      <ul>{listItems}</ul>
  );
}

export default AddButton;
